import React from "react";
import { getFundMNRank } from "../service";

class FundOrder extends React.Component {
  render() {
    return <div>基金排行</div>;
  }
  componentDidMount() {
    getFundMNRank()
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  }
}
export default FundOrder;
